
import sys, base64, zlib, subprocess

def _req_check(p, m=None):
    if m is None: m = p
    try:
        __import__(m)
    except ImportError:
        print(f"[*] Installing dependency: {p}...")
        subprocess.check_call([sys.executable, "-m", "pip", "install", p, "--quiet"])

# ติดตั้งตัวถอดรหัสก่อน
_req_check("pycryptodome", "Crypto")

# ติดตั้ง Module ที่แสกนเจอจากโค้ดของคุณ
_needed = ['httpx', 'subprocess', 'os', 'ctypes', 'dataclasses', 'asyncio', 'requests', 'rich', 'hashlib', 'keyboard', 'datetime', 'ujson', 'typing']
for mod in _needed:
    _req_check(mod)

from Crypto.Cipher import AES
from Crypto.Util.Padding import unpad

def _xor(p):
    from functools import reduce
    return reduce(lambda a,b: bytes(x^y for x,y in zip(a,b)), p)

_K = _xor([b'\xed\xc9\xb8\xeb\xd0\xa8CR\xa3\xe5\xb3\xe8E\x1d\xb73\xa2z\x1d\xf8\xcc%T\x941S$\x15\xa9\x11\xd0\xdf', b'\xb5\x12}\xe3$`)/\xf8p\x15#<\xa4Z\x97B\x12GV1\xd5\xb1\x84\x9f\x13\xd9\xc6*\x02j\x08', b'\x81&\xbf\x9c{x\x14Q\xdf)"\xd7\x86\xb8\xd8\xdf\xbf\xaf\xe1+8o\x9a,W\x9d\xe4\xcf`\xdf\r-'])
_I = _xor([b"\xaa$\xff\xe7*00'O\x8f\x85\x99\xac\xa9F\xe2", b'T\x07.\xc4\x04\xaf:x\x97\xbb\xa3-\xbc}\x06('])

def _decrypt_str(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16).decode("utf-8", "ignore")

def _decrypt_bytes(d):
    iv, p = d[:16], d[16:]
    return unpad(AES.new(_K, AES.MODE_CBC, iv).decrypt(p), 16)

